import Link from "next/link";
import SocialLinks from "./SocialLinks";

const Header = () => (
  <>
    <div className="wrapper">
      <Link href="/">
        <a className="navlink">H o m e</a>
      </Link>
      <Link href="/about">
        <a className="navlink">a b o u t</a>
      </Link>
    </div>
    <SocialLinks className="social" />
    <style jsx>
      {`
        .wrapper {
          display: flex;
          flex-direction: column;
          height: 100px;
          justify-content: center;
          margin-left: 15px;
          position: fixed;
          text-align: center;
          top: 45vh;
          z-index: 1;
        }
        .wrapper::after {
          content: "";
          display: block;
          width: 5px;
          height: 100px;
          background-color: black;
          margin: 0px auto;
        }
        .navlink {
          font-family: Montserrat;
          font-size: 15px;
          font-weight: 900;
          text-decoration: none;
          margin: 70px 0;
          transform: rotate(-90deg);
        }
        .navlink:visited {
          color: gray;
        }
        .navlink:hover {
          opacity: 0.5;
        }
      `}
    </style>
  </>
);

export default Header;
